display EmplItemId identification()
{
    if (this.checkAdjustmentType(ProjAdjustmentType::Item))
    {
        return this.ItemId;
    }

    return '';
}

display ResourceRecId identificationResource()
{
    if (this.checkAdjustmentType(ProjAdjustmentType::Hour))
    {
        return this.Resource;
    }

    return 0;
}

/// <summary>
///     Delegate for getting <c>ProjJournalType</c> enumeration value based on <c>ProjAdjustmentType</c> enumeration value.
/// </summary>
/// <param name = "_adjustmentType">
///     The transaction type.
/// </param>
/// <param name = "_eventHandlerResult">
///     An <c>EventHandlerResult</c> instance, where subscribers can provide default <c>ProjJournalType</c> enumeration value based on <c>ProjAdjustmentType</c> enumeration value.
/// </param>
static delegate void adjustmentType2JournalTypeDelegate(ProjAdjustmentType _adjustmentType, EventHandlerResult _eventHandlerResult)
{
}

/// <summary>
///     Gets <c>ProjJournalType</c> enumeration value based on <c>ProjAdjustmentType</c> enumeration value.
/// </summary>
/// <param name = "_adjustmentType">
///     The transaction type.
/// </param>
/// <returns>
///     The journal type.
/// </returns>
static ProjJournalType adjustmentType2JournalType(ProjAdjustmentType _adjustmentType)
{
    ProjJournalType projJournalType;

    switch (_adjustmentType)
    {
        case ProjAdjustmentType::Hour:
            projJournalType = ProjJournalType::Hour;
            break;

        case ProjAdjustmentType::Revenue:
            projJournalType = ProjJournalType::Revenue;
            break;

        default:
            EventHandlerResult result = new EventHandlerResult();
            TmpProjAdjustment::adjustmentType2JournalTypeDelegate(_adjustmentType, result);
            if(result.hasResult())
            {
                projJournalType = result.result();
            }
            else
            {
                throw error(strFmt("@SYS5932",_adjustmentType));
            }
    }

    return projJournalType;
}

