static boolean createReverseTrans(
ProjAdjustmentType  _adjustmentType)
{
    boolean returnValue = false;

    if (ProjFlightStateHelper::isProjUseFundingLimitTrackingForAdjustmentsFlightEnabled()
        && (_adjustmentType == ProjAdjustmentType::Hour
            || _adjustmentType == ProjAdjustmentType::Cost
            || _adjustmentType == ProjAdjustmentType::Revenue))
    {
        returnValue = true;
    }
    else if (ProjAdjSetExpenseTransAdjStatusFlight::instance().isEnabled() 
        && (_adjustmentType == ProjAdjustmentType::Hour || _adjustmentType == ProjAdjustmentType::Revenue))
    {
        returnValue = true;
    }
    else
    {
        // same as else if above, delete while removing ProjAdjSetExpenseTransAdjStatusFlight
        if (_adjustmentType == ProjAdjustmentType::Hour)
        {
            returnValue = true;
        }

        if (_adjustmentType == ProjAdjustmentType::Revenue)
        {
            returnValue = true;
        }
    }

    return returnValue;
}

    static AmountCur totalCostAmount(
    ProjTransIdBase        _transId,
    TmpProjAdjustment      _tmpProjAdjustment,
    TmpProjAdjustmentCost  _tmpProjAdjustmentCost
)
    {
        AmountCur               ret;
        TmpProjAdjustment       tmpProjAdjustmentLocal;
        TmpProjAdjustmentCost   tmpProjAdjustmentCostLocal;

        tmpProjAdjustmentLocal.linkPhysicalTableInstance(_tmpProjAdjustment);
        tmpProjAdjustmentCostLocal.linkPhysicalTableInstance(_tmpProjAdjustmentCost);

        select tmpProjAdjustmentLocal
        where tmpProjAdjustmentLocal.TransId == _transId;

        if (_tmpProjAdjustment)
        {
            while select tmpProjAdjustmentCostLocal
            where tmpProjAdjustmentCostLocal.TransId == tmpProjAdjustmentLocal.TransId
            {
                ret += (tmpProjAdjustmentLocal.priceQty() * tmpProjAdjustmentCostLocal.CostPrice);
            }
        }

        return ret;
    }

    static AmountCur totalSaleAmount(
    ProjTransIdBase        _transId,
    TmpProjAdjustment      _tmpProjAdjustment,
    TmpProjAdjustmentSale  _tmpProjAdjustmentSale
)
    {
        AmountCur               ret;
        TmpProjAdjustment       tmpProjAdjustmentLocal;
        TmpProjAdjustmentSale   tmpProjAdjustmentSaleLocal;

        tmpProjAdjustmentLocal.linkPhysicalTableInstance(_tmpProjAdjustment);
        tmpProjAdjustmentSaleLocal.linkPhysicalTableInstance(_tmpProjAdjustmentSale);

        select tmpProjAdjustmentLocal
        where tmpProjAdjustmentLocal.TransId == _transId;

        if (_tmpProjAdjustment)
        {
            while select tmpProjAdjustmentSaleLocal
            where tmpProjAdjustmentSaleLocal.TransId == tmpProjAdjustmentLocal.TransId
            {
                ret += (tmpProjAdjustmentLocal.priceQty() * tmpProjAdjustmentSaleLocal.SalesPrice);
            }
        }

        return ret;
    }

/// <summary>
///     Delegate for getting a new instance of <c>ProjTrans</c> object.
/// </summary>
/// <param name = "_tmpProjAdjustment">
///     A <c>TmpProjAdjustment</c> table buffer.
/// </param>
/// <param name = "_tmpProjAdjustmentSale">
///     A <c>TmpProjAdjustmentSale</c> table buffer.
/// </param>
/// <param name = "_allocateFlag">
///     A Boolean value that indicates to allocate the revenue.
/// </param>
/// <param name = "_eventHandlerResult">
///     An <c>EventHandlerResult</c> instance, where subscribers can provide default <c>ProjTrans</c> object.
/// </param>
static delegate void updateFundingLimitsDelegate(
    TmpProjAdjustment _tmpProjAdjustment, 
    TmpProjAdjustmentSale _tmpProjAdjustmentSale,
    boolean _allocateFlag,
    EventHandlerResult _eventHandlerResult)
{
}

    /// <summary>
    ///     Update the funding limit based on the information provided.
    /// </summary>
    /// <param name = "_tmpProjAdjustment">
    ///     A <c>TmpProjAdjustment</c> table buffer.
    /// </param>
    /// <param name = "_tmpProjAdjustmentSale">
    ///     A <c>TmpProjAdjustmentSale</c> table buffer.
    /// </param>
    /// <param name = "_allocateFlag">
    ///     A Boolean value that indicates to allocate the revenue.
    /// </param>
    static void updateFundingLimits(
    TmpProjAdjustment         _tmpProjAdjustment,
    TmpProjAdjustmentSale     _tmpProjAdjustmentSale,
    boolean                   _allocateFlag
)
    {
        ProjTrans   projTrans;
        int         mul;
        boolean     throwError;

        switch (_tmpProjAdjustment.AdjustmentType)
        {
            case ProjAdjustmentType::Hour :
                projTrans = ProjTrans::newProjEmplTrans(ProjEmplTrans::find(_tmpProjAdjustment.TransId));
                break;

            case ProjAdjustmentType::Cost:
                projTrans = ProjTrans::newProjCostTrans(ProjCostTrans::find(_tmpProjAdjustment.TransId));
                break;

            case ProjAdjustmentType::Revenue:
                projTrans = ProjTrans::newProjRevenueTrans(ProjRevenueTrans::find(_tmpProjAdjustment.TransId));
                break;

            case ProjAdjustmentType::Item:
                projTrans = ProjTrans::newProjItemTrans(ProjItemTrans::find(_tmpProjAdjustment.TransId));
                break;

            default:
                EventHandlerResult result = new EventHandlerResult();
                TmpProjAdjustment::updateFundingLimitsDelegate(_tmpProjAdjustment, _tmpProjAdjustmentSale, _allocateFlag, result);
                if(result.hasResult())
                {
                    projTrans = result.result() as ProjTrans;
                }
                else
                {
                    throw error("@SYS21628");
                }
        }

        if (_allocateFlag)
        {
            mul = 1;
            throwError = true;
        }
        else
        {
            mul = -1;
            throwError = false;
        }

        while select _tmpProjAdjustmentSale
        where _tmpProjAdjustmentSale.TransId == _tmpProjAdjustment.TransId
        {
			if (!ProjFlightStateHelper::isProjUseFundingLimitTrackingForAdjustmentsFlightEnabled())
			{
				ProjFundingEngine::updateFundingLimits(projTrans,
									_tmpProjAdjustmentSale.FundingSource,
									(mul * (_tmpProjAdjustmentSale.LineAmount + projTrans.psaIndirectAmount())),
									true,
									throwError);
			}
        }
    }

/// <summary>
/// Get the orignal project journal transaction for the ProjAdjustment.
/// </summary>
/// <param name="_tmpProjAdjustment">
/// The TmpProjAdjustment table.
/// </param>
/// <returns>
/// Returns orignal project journal transaction for the ProjAdjustment.
/// </returns>
public static Common getProjAdjustmentOriganlTrans(TmpProjAdjustment _tmpProjAdjustment)
{
    Common  projAdjustmentOriganlTrans;

    switch (_tmpProjAdjustment.AdjustmentType)
    {
        case ProjAdjustmentType::Hour :
            projAdjustmentOriganlTrans = ProjEmplTrans::find(_tmpProjAdjustment.TransId);
            break;

        case ProjAdjustmentType::Cost:
            projAdjustmentOriganlTrans = ProjCostTrans::find(_tmpProjAdjustment.TransId);
            break;

        case ProjAdjustmentType::Revenue:
            projAdjustmentOriganlTrans = projRevenueTrans::find(_tmpProjAdjustment.TransId);
            break;

        case ProjAdjustmentType::Item:
            projAdjustmentOriganlTrans = ProjItemTrans::find(_tmpProjAdjustment.TransId);
            break;
    }

    return projAdjustmentOriganlTrans;
}

